import React from 'react';
import cl from '../css/Exam.module.css';

const Exam = () => {
    return (
        <div className={cl.container}>
            <h1 className={cl.exam__title}>КОНТРОЛЬНАЯ РАБОТА №2</h1>
        </div>
    );
};

export default Exam;
